Sauce: 
1 cup orange juice (thanks to @jessmev’s @oddboxldn for the oranges)
1/2 cup sugar
2 tbsp rice vinegar 
2 tbsp soy sauce 
2 cloves garlic, minced
1/4 tsp ginger
1/4 tsp chilli flakes 
Zest from 1 orange
1 tbsp cornflour + 2 tbsp water 

Whisk ingredients and heat for 5 mins, then stir in cornflour and water mixture to thicken. Heat for further 5 mins until sticky. 

Slice chicken thighs into chunks, egg wash and dip in cornflour. Shallow fry until cooked through and crispy. Combine with sauce and garnish. 

