Ingredientes:
Jitomate - 4 piezas
Cebolla blanca - 1/2 de pieza
Ajo - 1 diente
Agua - 1/2 taza
Aceite - 2 cucharadas
Carne molida de res - 400 gramos
Caldo de pollo - 1 cubo
Zanahoria - 2 piezas pequeñas
Chícharo - 1/2 taza
Elote - 1/2 taza
Sal - al gusto
Chile serrano - 1 pieza

Instrucciones:
Comenzamos picando la mitad de la cebolla, pelamos la zanahoria y la cortamos en cubos. Picamos el chile serrano.
Cocemos por separado el elote, la zanahoria y el chícharo.
Mientras las verduras se cuecen, licuamos el jitomate, la mitad de la cebolla sin cortar, el ajo y el agua. Cuando todo quede completamente licuado, colamos y reservamos.
En una cacerola grande, calentamos el aceite, freímos la cebolla picada y añadimos la carne. Freímos todo hasta que la carne esté dorada.
Agregamos el caldo del jitomate que licuamos, añadimos el cubo de caldo de pollo y el chile serrano. Dejamos que hierva a fuego medio durante 5 minutos.
Agregamos las verduras, mezclamos todo, probamos y sazonamos con sal al gusto. Dejamos que se cocine durante 10 minutos y movemos algunas veces. 

